from typing import List
import collections
import bisect
class Solution:
    def numMatchingSubseq(self, s: str, words: List[str]) -> int:
        cd = collections.defaultdict(list)
        for i in range(len(s)):
            cd[s[i]].append(i)
                
        cnt = 0
        seenOK = set()
        seenNG = set()
        for w in words:
            if w in seenOK:
                cnt += 1
                continue
            if w in seenNG:
                continue

            cur = -1

            flag = True
            # find the bisect index of cur in cd[c]
            for c in w: 
                if c not in cd or not cd[c]:
                    flag = False
                    break
                i = bisect.bisect_right(cd[c], cur)
                # print('find i:', i)
                if i == len(cd[c]):
                    flag = False
                    break
                
                cur = cd[c][i]

                # print('after:', prev[c])
            if flag:
                seenOK.add(w)
                cnt += 1
            else:
                seenNG.add(w)
            # print('cnt ====> ',cnt)
        
        return cnt

